import React, { useEffect } from 'react';
import { useLocation } from 'react-router-dom';

const QuoteCalculator = () => {
  const location = useLocation();
  const { state } = location;
  const { startCity, endCity, distance } = state;

  useEffect(() => {
    // Do something with startCity, endCity, and distance
    console.log(`Calculating quote for the distance between ${startCity} and ${endCity}: ${distance} km`);
  }, [startCity, endCity, distance]);

  return (
    <div>
      <h2>Quote Calculator</h2>
      {/* Display calculated quote or form for calculating the quote */}
      <p>
        Calculating quote for the distance between {startCity} and {endCity}: {distance} km.
        {/* Add your quote calculation logic or UI here */}
      </p>
    </div>
  );
};

export default QuoteCalculator;
